import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Books = () => {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/books') // Zmieniono URL na adres lokalny Laravela
      .then(response => {
        setBooks(response.data.books); // Dostosowano do struktury odpowiedzi z backendu
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Books</h1>
      <ul>
        {books.map(book => (
          <li key={book._id}>{book.title} by {book.author} - Price: {book.price}</li>
        ))}
      </ul>
    </div>
  );
};

export default Books;
